import Data from "../Assets/Data/data.json"
import RowCardContent from "../layouts/RowCardContent";

const updateData = Data.data[0].updateSection;
const testData = Data.data[0].lastWorks;

function HomeView() {
    return <div>
        <RowCardContent title="Latest Update" contentData={updateData} />
        <RowCardContent title="Coming Soon" contentData={testData} />
    </div>
}

export default HomeView;
